import React from 'react'

import './Image.css'

import Particles from 'react-particles-js';

const Image = () =>(
    <div className="Image-background">
 <Particles 
                params={{
                    polygon: {
                        enable: true,
                        type: 'inside',
                        move: {
                            radius: 10
                        },
                        url: 'path/to/svg.svg'
                    }
                }} />


    </div>
)

export default Image
